import React from 'react';
import { Card } from 'react-bootstrap';
import './src/Styles/ServerList.css';

function ServerItem({ item }) {
    const { name, ipAddress, port } = item;

    return (
        <Card className="server-item">
            <Card.Title>{name}</Card.Title>
            <Card.Subtitle>{ipAddress}</Card.Subtitle>
            <Card.Text>{`Порт: ${port}`}</Card.Text>
        </Card>
    );
}

export default ServerItem;
